    <>
      <div className="navbar">
        <Link to="#" className="menu-bars">
          <Hamburger></Hamburger>
        </Link>
      </div>
      <nav className={sidebar ? "nav-menu active" : "nav-menu"}></nav>
    </>
  );
}

export default Navbar;
